INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `location`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`) VALUES ( 6, 3, 1400847066, 'Contao North-Day', 'contao-north-day', 10, '', 1414274400, 1414364399, 1414274400, NULL, '', '<p>The Contao North-Day is an event dedicated to Contao users, developers and supportes situated in the north of Germany. The event started in 2013 and takes place in Hamburg. In a series of presentations participants get the chance to learn from first hand experience from expterts of varying fields and to expand their horizons in the website development context. [nbsp]</p>', '', 0x00000000000000000000000000000000, '', '', '', '', '', '', '', '1', 'a:2:{s:4:"unit";s:5:"years";s:5:"value";s:1:"1";}', 2145913200, 0, '', '', 'default', 0, 0, '', '', '', '', '1', '', '' );
