 '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', 0x00000000000000000000000000000000, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default' );
