INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `title`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `shClass`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `space`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES ( 309, 77, 'tl_article', 768, 1400846675, 'text', 'a:2:{s:4:"unit";s:2:"h2";s:5:"value";s:7:"Listing";}', '<p>The module Article list will make a list of data sets available on the website. The list can be sorted, viewed with applied filters and searched by Front-End users. A table drawn from a database acts as the basis for the list.</p>\n<p>In „Table“ you are defining the source table from which the list is generated.[nbsp]The parameter „cells“ enables you to list the fields to be included in the list. You have to seperate the list entries by comma.[nbsp]„Condition“ allows you to define a condition by which the data sets extracted from the database will be filtered. Since the module pretty much executes a database query, you are able to utilize SQL-conform code. You can also use Insert-Tags.</p>\n<p>When using the module Contao will automatically generate a query template in the Front-End to search the list. In the parameter „Searchable cells“ you can define which cells will be included in the search options.</p>\n<p>The „Sort by“ parameter allows you to set by which column from the source table the displayed list will be sorted. „Elements per page“ is a parameter which when you set it to a value higher than 0 will result in Contao displaying the images on multiple pages.</p>\n<p>You can control for which cells a detail page with all information from the given data set will be available. By tagging the desired cell in the parameter „cells of detail page“ a small icon will appear next to each data set of the tagged cell. If the Front-End user clicks on the icon the detail page of that data set will be displayed and the next page menue uses pagination.</p>\n<p>The „detail page condition“ parameter offers a way to filter the data sets to be displayed on the detail page of each cell.<br>The parameter „list template“ allows you to define a layout template for how the list will look like.</p>\n<p>Analogous to the list template parameter the „detail page template“ enables you to set up a layout template for the detail page.[nbsp]The module „article list“ utilizes the CSS classes mod_listing, the search query features uses list_search, the drop-down-menue by which the data set selection per page is done uses list_per_page.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default' );
